window.bookSummaryJSON = "<p>Crackpot is what everybody calls the Pott family. So when they go to buy a new car and come back with a wreck, nobody is surprised. Except for the Potts themselves. First, the car has a name. And she tells them what it is. Then they find that she can fly... and swim... </p> <p>Chitty Chitty Bang Bang is a car on a mission to stop a criminal gang in its tracks and she is taking the Potts with her! Jump into the world s most loved magical car, for her first adventure ever! </p> <p>Â© Ian Fleming Publications Ltd 1964, 1965, (P) Ian Fleming Publications Ltd, 2013. Chitty Chitty Bang Bang is a registered trademark of Danjaq LLC and United Artists Corporation, used under licence by Ian Fleming Publications Ltd. All rights reserved.</p>"; 
